const claims = msg._client.user.claims;

msg.payload = [];

Object.entries(claims).forEach(([name, value]) => {

    msg.payload.push(
        {
            "Name": name,
            "Wert": value
        }
    )

});

msg.payload = msg.payload.sort((a, b) => a.Name.localeCompare(b.Name, "de", { sensitivity: "base" }))

return msg;
